import ArrowForwardIcon from "@material-ui/icons/ArrowForward";
import { Redirect } from "react-router-dom";
import "./Button.css";

function Button(props) {
  const clickHandler = () => {
    alert("Clicked");
    <Redirect to={{ pathname: "/restaurant" }} />;
  };

  return (
    <button onClick={clickHandler}>
      <ArrowForwardIcon />
    </button>
  );
}

export default Button;
